import React from "react";
import { Button } from 'reactstrap';
import './styles/SingleReport.css'

function SignleReport({ state, type, message, reps, setReps }) {

    function deleteHandler() {
        setReps(reps.filter((el) => el.id !== reps.id));
        console.log(setReps);
    }

    return <div>
        <tr>
            <td>State: {state}</td>
        </tr>
        <tr>
            <td>Type: {type}</td>
        </tr>
        <tr>
            <td>Message: {message}</td>
        </tr>

        
            <Button  onClick={deleteHandler} color="primary">Resolve</Button>
     
        <p className="btn block">
            <Button color="danger">Block</Button>
        </p>
        

    </div>
}

export default SignleReport;
